import React from "react";

const ConsolidationTable2 = ({ acciones }) => {
  const accionesAgrupadas = [
    { nombre: "AMZN", totalCantidad: 7, totalUSD: 700.00, precioCosto: 100.00 },
    { nombre: "META", totalCantidad: 1, totalUSD: 400.00, precioCosto: 400.00 },
    { nombre: "INTC", totalCantidad: 3, totalUSD: 74.60, precioCosto: 24.87 },
    { nombre: "NVDA", totalCantidad: 3, totalUSD: 338.00, precioCosto: 112.67 },
    { nombre: "TSLA", totalCantidad: 1, totalUSD: 300.00, precioCosto: 300.00 },
    { nombre: "BABA", totalCantidad: 3, totalUSD: 285.25, precioCosto: 95.08 }
  ];

  // Calculate metrics using table columns
  const calculateMetrics = (accion) => {
    const valorUSD = accion.totalUSD;
    const cantidadTotal = accion.totalCantidad;
    const precioCosto = accion.precioCosto;
    
    // Calculate gain/loss percentage
    const gananciaPercentage = 0.00;
    
    // Calculate gain/loss in USD
    const gananciaPerdidaUSD = 0.00;

    return {
      valorUSD: valorUSD.toFixed(2),
      precioCosto: precioCosto.toFixed(2),
      gananciaPercentage: gananciaPercentage.toFixed(2),
      gananciaPerdidaUSD: gananciaPerdidaUSD.toFixed(2)
    };
  };

  return (
    <div className="mt-8 p-6 bg-white rounded-lg shadow-lg">
      <h2 className="text-xl font-bold mb-4">Consolidación de Acciones</h2>
      <div className="overflow-x-auto">
        <table className="w-full border-collapse">
          <thead>
            <tr className="bg-gray-50">
              <th className="border p-2 text-left">ACCIÓN</th>
              <th className="border p-2 text-right">CANTIDAD TOTAL</th>
              <th className="border p-2 text-right">VALOR USD</th>
              <th className="border p-2 text-right">PRECIO DE COSTO</th>
              <th className="border p-2 text-right">%GANANCIA/PÉRDIDA</th>
              <th className="border p-2 text-right">$GANANCIA/PÉRDIDA</th>
            </tr>
          </thead>
          <tbody>
            {accionesAgrupadas.map((accion, index) => {
              const { 
                valorUSD, 
                precioCosto, 
                gananciaPercentage, 
                gananciaPerdidaUSD 
              } = calculateMetrics(accion);

              return (
                <tr key={index} className="hover:bg-gray-50">
                  <td className="border p-2">{accion.nombre}</td>
                  <td className="border p-2 text-right">{accion.totalCantidad}</td>
                  <td className="border p-2 text-right">{valorUSD}</td>
                  <td className="border p-2 text-right">{precioCosto}</td>
                  <td className="border p-2 text-right">{gananciaPercentage}%</td>
                  <td className="border p-2 text-right">{gananciaPerdidaUSD}</td>
                </tr>
              );
            })}
          </tbody>
        </table>
      </div>
    </div>
  );
};

export default ConsolidationTable2;
